import {BrowserRouter ,Route, Routes } from 'react-router-dom';

import Login from './login/index';
import Torcida from './torcedores/index';

function App() {
  return(
    <div>
  <BrowserRouter>
            <Routes>
                <Route path="/" component={Login} /> 
                <Route path="/torcedores" component={Torcida} />
            </Routes>
        </BrowserRouter>

        </div>
          )

}
export default App;
